import React from "react";

// TODO:
// 1. FLITER COMPONENT
// 2. DIVIDER + SORT
// 3. GRIDVIEW + LISTVIEW
// API TO USE: https://developers.themoviedb.org/3/discover/movie-discover
export const Movies_Page = () => {
  return (
    <section className="border rounded-lg shadow-xl my-10 p-5 leading-loose">
      <div>
        <h2>Release Date: </h2>
      </div>
      <div>
        <h2>Genres: </h2>
      </div>
      <div>
        <h2>Certification: </h2>
      </div>
      <div>
        <h2>Language: </h2>
      </div>
      <div>
        <h2>User Score: </h2>
      </div>
      <div>
        <h2>keyword: </h2>
      </div>
    </section>
  );
};

export default Movies_Page;
